import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="App-header">
        <p className="App-link">Counter</p>
        <div className="counter">
          <button className="counterSign">+</button>
          <input type="text" className="counterValue" />
          <button className="counterSign">-</button>
        </div>
      </div>
    </div>
  );
}

export default App;
